const SearchPopup = () => {
  return (
    <div>
      <form>
        <h1>Search</h1>
        <div>
          <p>Destination</p>
          <input></input>
        </div>
        <div>
          <p>Check-in-Date</p>
          <input></input>
        </div>
        <div>
          <p>Options</p>
          <input>Min price</input>
        </div>
      </form>
    </div>
  );
};
export default SearchPopup;
